/** assert.js * @version 1.1.0 min * @see https://github.com/Serrin/assert.js * @license MIT */
(function(window){
"use strict";
function assert(c,...a){if(!c){throw new Error(a.length?"Assertion failed: "+JSON.stringify(a).slice(1,-1).replaceAll(",",", "):"Assertion failed");}return true;}
if(typeof window!=="undefined"){window.assert=assert;}
}(window));